import React from 'react';

class Header extends React.Component {
    render(){

        const styles = {
            header: {
                background: '#03a9f4'
            },
            logo: {
                color: '#fff',
                fontFamily: 'Roboto',
                textAlign: 'center'
            }
        }

        return (
            <header style={styles.header}>
                <div style={styles.logo}>Logo</div>
                <input type="text" />
            </header>
        )
    }
}

export default Header;
